import React from 'react'
import logo from "../Assets/Logo/logo-transparent-png.png"

export default function Header() {
  return (
    <div>
        <img className="logo" src={logo} />
        <ul>
            <h1>Blog</h1>
            <h1>About</h1>
        </ul>


    </div>
  )
}
